private static String stripQuotes(String s) {
  StringBuilder buf = new StringBuilder();
  for(int i=0; i<s.length(); i++) {
    char c = s.charAt(i);
    if(c != '"') {
      buf.append(c);
    }
  }

  return buf.toString();
}

